description:
Perfect Secretaries
~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~

Synopsis: Who says you can't have fun in the office? All it takes is a hot secretary that is down for anything and work can be loads of fun!! These horny secretaries are up for anything on the job and will do whatever it takes to get ahead in their line of work. They sure go above and beyond for their bosses!!

Cast: Jada Stevens, Alexis Brill, Tiffany Doll, Donna Bell, Caty Cambel, George Uhl, James Brossman, Nick Lang, Lauro Giotto

